// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

interface ERC20 {
    function totalSupply() external view returns (uint _totalSupply);
    function balanceOf(address _owner) external view returns (uint balance);
    function transfer(address _to, uint _value) external returns (bool success);
    function transferFrom(address _from, address _to, uint _value) external returns (bool success);
    function approve(address _spender, uint _value) external returns (bool success);
    function allowance(address _owner, address _spender) external view returns (uint remaining);
    event Transfer(address indexed _from, address indexed _to, uint value);
    event Approval(address indexed _owner, address indexed _spender, uint value);
}


contract ERC20Practice is ERC20 {
    string public constant symbol = "PRCT";
    string public constant name = "PracticeToken";
    uint public constant decimals = 18;

    uint256 public constant totalSupply = 1000*10^decimals;

    mapping(address => uint) private __balances;

    mapping(address => mapping(address => uint)) private __allowances;

    constructor() {
        __balances[msg.sender] = totalSupply;
    }

    function balanceOf(address _addr) public override view returns(uint) {
        return __balances[_addr];
    }

    function transfer(address _to, uint _value) public override returns(bool) {
        if (__balances[msg.sender] < _value)         
            return false;

        __balances[msg.sender] -= _value;
        __balances[_to] += _value;

        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFrom(address _from, address _to, uint _value) public override returns(bool) {
        if (__allowances[_from][_to] < _value || isContract(_to))
            return false;

        __balances[_from] -= _value;
        __balances[_to] += _value;
        return true;
    }


    function isContract(address _addr) private view returns(bool) {
        uint codeSize;
        assembly {
            codeSize := extcodesize(_addr)
        }
        return codeSize > 0;
    }

    function approve(address _addr, uint _amount) public override returns(bool) {
        if (__balances[msg.sender] < _amount)
            return false;

        __allowances[msg.sender][_addr] = _amount;

        emit Approval(msg.sender, _addr, _amount);
        return true;
    }

    function allowance(address _owner, address _spender) public view override returns(uint remaining) {
        return __allowances[_owner][_spender];
    }

}
